@graffitithecorgi always has one eye open to watch momma 😅. 

I just put up a story about this but there was intense thunder and lightning last night and Graffiti sat on my chest for a while, then jumped over to poppa, then laid between us while we pet him and hugged him. He was trembling but eventually fell asleep in our arms 🥹. Poor thing, thunder has never bothered him til he got older. He’s such a sensitive, sweet soul ❤️. 

