@graffitithecorgi has become sensitive to loud noises as he’s aged. He jumps on top of us in bed and trembles when there’s thunder/lighting, and recently he started getting nervous whenever heavy snow sheets would fall onto our roof from the trees above. He sat on my shoulder and lap all morning until the snow sheets stopped falling...poor sensitive baby 🥹.

Is your dog afraid of loud noises too? For some reason he doesn’t mind fireworks though 😅. At least he hasn’t in previous years, it might be different now. 

